import React, {useState} from 'react'
import { Link } from 'react-router-dom'

function Page2() {
  return (
    <div className='slide-section about-section'>
      <h1>Secrets to Selling Your Storage Facility and Free Tools</h1>
      <p style={{fontSize: "120%", marginBottom: "-4%"}}>We help storage owners get the most money and pay the least taxes when selling their self-storage business. We are a community of self-storage owners, built by owners. We want to share knowledge, information, and tools to help you make the best decisions when selling your self-storage business. </p>
    </div>
  )
}

export default Page2
